import React from "react";
import "./"

const About = () =>{
    return(
        <div className="about">
          <p>Welcome everyone! <br />
            This is my first full stack project. i create a platform for sharing tattoos. <br />
            Here you can  share your tattoos and get ideas from other artists and people that share the love for tattoos. <br />
            Enjoy! 
          </p>
        </div>
        
    )
}

export default About
